class FunctionBlockVisitorTest(unittest.TestCase):

  @parameterized.expand([
      ('def foo(bar, baz, *args, **kwargs): pass',
       {'bar': block.Var('bar', block.Var.TYPE_LOCAL, init_expr='Args[0]'),
        'baz': block.Var('baz', block.Var.TYPE_LOCAL, init_expr='Args[1]'),
        'args': block.Var('args', block.Var.TYPE_LOCAL, init_expr='Args[2]'),
        'kwargs': block.Var('kwargs', block.Var.TYPE_LOCAL, init_expr='Args[3]')}),
  ])
  def testArgs(self, func_str, expected_vars):
    func = _ParseStmt(func_str)
    visitor = block.FunctionBlockVisitor(func)
    self.assertEqual(sorted(visitor.vars.keys()), sorted(expected_vars.keys()))
    for var, expected in expected_vars.items():
      self.assertRegexpMatches(visitor.vars[var].init_expr, expected)

  @parameterized.expand([
      ('def foo(bar, baz, bar=None): pass',),
  ])
  def testArgsDuplicate(self, func_str):
    with self.assertRaisesRegex(util.ParseError, 'duplicate argument'):
      block.FunctionBlockVisitor(_ParseStmt(func_str))

  @parameterized.expand([
      ('def foo(): pass',),
  ])
  def testYield(self, func_str):
    visitor = block.FunctionBlockVisitor(_ParseStmt(func_str))
    visitor.visit(_ParseStmt('yield "foo"'))
    self.assertTrue(visitor.is_generator)

  @parameterized.expand([
      ('def foo(): pass',),
  ])
  def testYieldExpr(self, func_str):
    visitor = block.FunctionBlockVisitor(_ParseStmt(func_str))
    visitor.visit(_ParseStmt('foo = (yield)'))
    self.assertTrue(visitor.is_generator)
    self.assertEqual(sorted(visitor.vars.keys()), ['foo'])
    self.assertRegexpMatches(visitor.vars['foo'].init_expr, 'UnboundLocal')


